    "md": "# Terrarium",
    "hash": "8rJDQrje/r+tCwiBCP2T+y43pyL8cD3GM9ZKxRKyMXo=",

  {
    "hash": "lSrRnTnqzldEPV3akgn+Rmgh9JnfwOz7S8ReipebdQw=",
    "sourceText": "md`\nThis is a simple terrarium design intended to be cut from transparent acrylic.\n\n* The terrarium forms a box with the corners removed, allowing for excess water drainage.\n* A hole is provided in the top to allow the top panel to be removed or water to be added.\n* A lid is provided for the hole to minimize moisture loss.\n\nThis terrarium was designed for growing moss, but might be useful for other kinds of plants as well.\n`;",
    "sourceLocation": {
      "path": "nb/projects/pentacular/terrarium/terrarium.nb",
      "id": "$2"
    }
  },
  {
    "md": "\nThis is a simple terrarium design intended to be cut from transparent acrylic.\n\n* The terrarium forms a box with the corners removed, allowing for excess water drainage.\n* A hole is provided in the top to allow the top panel to be removed or water to be added.\n* A lid is provided for the hole to minimize moisture loss.\n\nThis terrarium was designed for growing moss, but might be useful for other kinds of plants as well.\n",

  {
    "hash": "KPu4UR+0vHYyBy75G/MkVIKnt6m4rYhlxmnAl5vFISk=",

  {
    "hash": "dbqbgX9pD5ZtEusRUU0A/FzA3eY9onlfeNLTOAzyqyQ=",
    "sourceText": "const thickness = control('pane thickness', 3, 'input');",

  {
    "hash": "y/KjlbsH1YM7Rob5NCR1MQydEePeovkREHcNTyKHO9s=",
    "sourceText": "const hingeLength = control('hinge length', 5, 'input');",
    "sourceLocation": {

  {
    "control": {

    }
  },
  {
    "hash": "Ha0M6u8BYh8iMK0xjCM1jSOeJkn5RBfZPthDIfPSB6s=",
    "sourceText": "const kerf = control('kerf', 0.09, 'input');",
    "sourceLocation": {

    },

    "sourceLocation": {

      "id": "kerf"
    }
  },
  {
    "hash": "Myo2JOb7ooAHN10VdYf6pyqB85OjzxhXlr/sk8Ok91M=",
    "sourceText": "const holeDiameter = control('hole diameter', 20, 'input');",
    "sourceLocation": {
      "path": "nb/projects/pentacular/terrarium/terrarium.nb",
      "id": "holeDiameter"
    }
  },
  {
    "control": {
      "type": "input",
      "label": "hole diameter",
      "value": 20,
      "path": "nb/projects/pentacular/terrarium/terrarium.nb"
    },
    "hash": "zv5qCEXYMYevdiyv5SfpbBOLuZfYiXPMMdXytkM5KSQ=",
    "sourceLocation": {
      "path": "nb/projects/pentacular/terrarium/terrarium.nb",
      "id": "holeDiameter"
    }
  },
  {
    "hash": "bzm8P08biy4VEIocnHQv/nW+YuB2y+XIakl9I4rSkjY=",
    "sourceText": "const Hinge = (l, thickness, hingeLength) =>\n  Seq(\n    { from: 0, by: hingeLength * 2, upto: l / 2 },\n    (offset) =>\n      Group(\n        Box(\n          [0, -thickness],\n          [0, -thickness],\n          [l / 2 - offset - hingeLength * 2, l / 2 - offset - hingeLength]\n        ),\n        Box(\n          [0, -thickness],\n          [0, -thickness],\n          [l / 2 + offset, l / 2 + offset + hingeLength]\n        )\n      ),\n    Group\n  ).clip(Box([0, -thickness], [0, -thickness], [0, l]));",
    "sourceLocation": {
      "path": "nb/projects/pentacular/terrarium/terrarium.nb",
      "id": "Hinge"
    }
  },
  {
    "hash": "ZJubQhE654mT86cVhP7167t1H4dwIOFgUJ81O7GowE4=",
    "sourceText": "const Lid = (holeDiameter, thickness, kerf) =>\n  Arc(holeDiameter)\n    .op(ez(-thickness), offset(2).ez(thickness))\n    .fitTo(\n      Box(thickness - kerf * 2, thickness - kerf * 2, thickness * 2).as('pin')\n    )\n    .material('acrylic')\n    .as('lid');",
    "sourceLocation": {
      "path": "nb/projects/pentacular/terrarium/terrarium.nb",
      "id": "Lid"
    }
  },
  {
    "hash": "LneLotDPj5jXLQVu4wbXt4hjL8tqFOoTuKaJZlZHm4Y=",
    "sourceText": "const makeLid = () => (shape) =>\n  shape\n    .get('lid')\n    .in()\n    .note('#### Lid')\n    .note('These profiles assemble to form the lid')\n    .pdf(\n      'lid_base',\n      z(-thickness / 2)\n        .section()\n        .outline()\n        .clean(1)\n    )\n    .pdf(\n      'lid_top',\n      z(thickness / 2)\n        .section()\n        .clean()\n        .outline()\n    )\n    .pdf(\n      'lid_pin',\n      get('pin')\n        .rx(1 / 4)\n        .section()\n        .flat()\n        .offset(kerf)\n        .clean()\n        .outline()\n    )\n    .note(\n      'Stack the larger disc on the smaller and then push the rectangular pin through to connect them.'\n    );",
    "sourceLocation": {
      "path": "nb/projects/pentacular/terrarium/terrarium.nb",
      "id": "makeLid"
    }
  },
  {
    "hash": "ZFEtIs1BEdKGEyvea2/YZj6l/Lbh/IiG3jTJzchTX34=",
    "sourceText": "const Terrarium = (\n  length,\n  width,\n  height,\n  thickness,\n  hingeLength,\n  holeDiameter,\n  kerf\n) =>\n  Box(length, width, [0, height])\n    .faces()\n    .eachEdge(\n      (e, l) => Hinge(l, thickness, hingeLength).to(e),\n      (e, f) => f.e(-thickness).cut(e)\n    )\n    .cut(Arc(holeDiameter, holeDiameter, [height - thickness, height]))\n    .material('acrylic')\n    .clean()\n    .as('terrarium');",
    "sourceLocation": {
      "path": "nb/projects/pentacular/terrarium/terrarium.nb",
      "id": "Terrarium"
    }
  },
  {
    "hash": "m/bxh3JxT4B2KwnYHqFHDmrkt2AVYox44CMWtGuQzcM=",
    "sourceText": "const makeTerrarium = () => (shape) =>\n  shape\n    .get('terrarium')\n    .in()\n    .each(flat())\n    .section()\n    .offset(kerf)\n    .note('#### Panels')\n    .note(\n      \"These are the profiles you'll need to cut out to assemble the terrarium.\"\n    )\n    .pdf('faces', outline().page('pack', { itemsPerPage: 1 }))\n    .note('Fit the profiles together to form a box with the hole on the top.');",
    "sourceLocation": {
      "path": "nb/projects/pentacular/terrarium/terrarium.nb",
      "id": "makeTerrarium"
    }
  },
  {

    "sourceText": "md`This is a preview of the assembled ${length}x${width}x${height}mm terrarium formed from ${thickness}mm acrylic with a ${hingeLength}mm hinge length and a ${holeDiameter}mm diameter hole in the top with matching plug, cut with a ${kerf}mm laser beam.`;",
    "sourceLocation": {

  {
    "md": "This is a preview of the assembled 50x50x50mm terrarium formed from 3mm acrylic with a 5mm hinge length and a 20mm diameter hole in the top with matching plug, cut with a 0.09mm laser beam.",

    "hash": "MlYE2kRVacg3Dgmpkl/Yp2TjmiE3aKYYDp53PKtOaqI=",
    "sourceText": "md`\n### Instructions\n\nSpecify the dimensions of the terrarium you want, taking some care with the sheet thickness and kerf.\n\nI recommend cutting two pieces to test how well they mesh with the kerf supplied.\n\nThe panels should have a snug fit, so that the assembly is solid without requiring glue.\n\nThe lid should have a snug fit internally, but a loose connection to the top panel so that it can be easily removed.\n`;",
    "sourceLocation": {
      "path": "nb/projects/pentacular/terrarium/terrarium.nb",
      "id": "$6"
    }

  {
    "md": "\n### Instructions\n\nSpecify the dimensions of the terrarium you want, taking some care with the sheet thickness and kerf.\n\nI recommend cutting two pieces to test how well they mesh with the kerf supplied.\n\nThe panels should have a snug fit, so that the assembly is solid without requiring glue.\n\nThe lid should have a snug fit internally, but a loose connection to the top panel so that it can be easily removed.\n",

    const prepareViews = async (notebook) => {
      // Prepare the view urls in the browser.
      for (const note of notebook) {
        if (note.view && !note.url) {
          note.url = await dataUrl(Shape.fromGeometry(note.data), note.view);
        }
      }
      return notebook;
    }

    const run = async () => {
      const body = document.getElementsByTagName('body')[0];
      const bookElement = document.createElement('div');
      const notebookElement = await toDomElement(await prepareViews(notebook));
      bookElement.appendChild(notebookElement);
      body.appendChild(bookElement);
      bookElement.classList.add('book', 'notebook', 'loaded');
    };

    if (document.readyState === 'complete') {
      run();
    } else {
      document.onreadystatechange = () => {
        if (document.readyState === 'complete') {
          run();
        }
      };
    }
